		// פונקציה ליצירת שאלה
		function createQues() {
		
			//אם אורך מערך השאלות לא שווה לאחד
			if (gameQues.length == 1 || lastQuestion == "none") {
				//תגריל את השאלה האחרונה שנשארה
				randomQues = parseInt(Math.random() * (gameQues.length));
			} else {
				// תגריל שאלה שהיא לא השאלה האחרונה שטעו בה
				while (randomQues == lastQuestion) {
					//הגרלת שאלה מתוך מערך השאלות
					randomQues = parseInt(Math.random() * (gameQues.length));
				}
				lastQuestion = "none";
			}
		
			// משתנה לאחסון הגרפיקה של השאלה
			var sign;
		
			var numOfAnswers = gameQues[randomQues].length - 1;
		
			//תנאי שבודק עם השאלה מכילה רק טקסט או טקסט ותמונה ולפי זה יוצר את השאלה
			if (gameQues[randomQues][0][1] != "text") {
				// יצירת שלט לשאלה עם תמונה
				sign = new lib.signImg_gm();
				sign.si_qTxt.text = gameQues[randomQues][0][0];
				sign.si_qTxt.font = "22px Rubik";
				sign.si_qTxt.lineHeight = 28;
				sign.si_qTxt.color = "#666666";
		
				// כתיבת נושא המשחק על גבי השלט
				sign.si_subjectTxt.text = gameSubject;
				sign.si_subjectTxt.font = "18px Rubik";
				sign.si_subjectTxt.color = "#666666";
		
				//יצירת התמונה של השאלה
				var imgQuestion = new(gameQues[randomQues][0][1]);
				imgQuestion.y = 200;
				imgQuestion.x = -160;
				sign.addChild(imgQuestion);
		
				// הוספת אירוע מעבר עכבר
				imgQuestion.addEventListener("mouseover", biggerImgQues);
				imgQuestion.addEventListener("mouseout", smallerImgQues);
		
				// הוספת אייקון של פלוס על גבי התמונה
				var plus = new lib.plusQues_icon();
				imgQuestion.addChild(plus);
				plus.y = (imgQuestion.getBounds().height / 2) - 15;
				plus.x = -(imgQuestion.getBounds().width / 2 - 15);
				plus.name = "plusQues";
		
			} else {
				// יצירת שלט עבור שאלה עם טקסט בלבד
				sign = new lib.signTxt_gm();
				sign.st_qTxt.text = gameQues[randomQues][0][0];
				sign.st_qTxt.color = "#666666";
				sign.st_qTxt.textBaseline = "middle";
		
				// שינוי גודל הטקסט לפי מספר התווים
				if (gameQues[randomQues][0][0].length <= 95) {
					sign.st_qTxt.font = "32px Rubik";
				} else if (gameQues[randomQues][0][0].length < 180) {
					sign.st_qTxt.font = "22px Rubik";
					sign.st_qTxt.lineHeight = 26;
				} else {
					sign.st_qTxt.font = "18px Rubik";
					sign.st_qTxt.lineHeight = 30;
				}
		
				// כתיבת נושא המשחק על גבי השלט
				sign.st_subjectTxt.text = gameSubject;
				sign.st_subjectTxt.font = "16px Rubik";
				sign.st_subjectTxt.color = "#666666";
		
			}
			// הגדרות כלליות עבור השלט
			sign.x = stageW / 2;
			gameGraphic.addChild(sign);
		
			// משתנה לשמירת מספר הדמות של השחקן הפעיל
			var charPlayer = players[currentPlayer][1];
		
			// יצירת הדמות הפעילה
			var mainChar = new(characters[charPlayer][8]);
			mainChar.x = stageW / 2 - 28;
			mainChar.y = 455;
			mainChar.name = "currentChar";
			gameGraphic.addChild(mainChar);
		
			//הכנסת המסיחים של השאלה שהוגרלה לתוך מערך המסיחים הרנדומלי
			for (i = 1; i < gameQues[randomQues].length; i++) {
				randomAnswers.push([gameQues[randomQues][i][0], gameQues[randomQues][i][1], gameQues[randomQues][i][2]]);
			}
		
			//תנאי שבודק את כמות המסיחים ולפיו יוצר את המסיחים
			if (numOfAnswers == 2) {
				createAnswers(2);
			} else if (numOfAnswers == 3) {
		
				createAnswers(3);
			} else if (numOfAnswers == 4) {
		
				createAnswers(4);
			} else if (numOfAnswers == 5) {
		
				createAnswers(5);
			}
		
		}
		
		// ----------------------------------------------------------------------------
		//                           מסך משחק - יצירת מסיחים
		// ----------------------------------------------------------------------------
		
		// יצירת מסיחים
		function createAnswers(answersNum) {
			for (i = 1; i <= answersNum; i++) {
				// משתנה לשמירת הסימבול של המסיח
				var answer = new lib.answer_gm();
				// משתנה לשמירת מיקום מסיח רנדומלי
				var rndAnswer = parseInt(Math.random() * (randomAnswers.length));
				// משתנה לשמירת הסימבול של הטקסט של המסיח
				var answerTxtBox;
		
				// אם המסיח מכיל תמונה
				if (randomAnswers[rndAnswer][1] != "text") {
					//יצירת התמונה של המסיח
					var imgAnswer = new(randomAnswers[rndAnswer][0]);
					imgAnswer.y = -87;
					imgAnswer.name = "imgAns" + i;
					answer.addChild(imgAnswer);
		
					// יצירת אייקון פלוס על גבי התמונה
					var plus = new lib.plusAns_icon();
					imgAnswer.addChild(plus);
					plus.y = (imgAnswer.getBounds().height / 2) - 15;
					plus.x = -(imgAnswer.getBounds().width / 2 - 15);
					plus.name = "plusAns" + i;
		
					// הוספת אירועי מעבר עכבר
					imgAnswer.addEventListener("mouseover", biggerImgAns);
					imgAnswer.addEventListener("mouseout", smallerImgAns);
		
				} else {
					// אם המסיח מכיל טקסט, מודפס הטקסט של המסיח לתיבת הטקסט
					answerTxtBox = new lib.at_TxtBox();
					answerTxtBox.name = "answerTxt" + i;
					answerTxtBox.at_Txt.text = randomAnswers[rndAnswer][0];
					answerTxtBox.at_Txt.color = "#666666";
		
					// גדלים משתנים בהתאם לכמות הטקסט
					if (randomAnswers[rndAnswer][0].length <= 15) {
						answerTxtBox.at_Txt.font = "28px Rubik";
						answerTxtBox.at_Txt.lineHeight = 38;
		
					} else if (randomAnswers[rndAnswer][0].length <= 25) {
						answerTxtBox.at_Txt.font = "22px Rubik";
						answerTxtBox.at_Txt.lineHeight = 28;
		
					} else {
						answerTxtBox.at_Txt.font = "16px Rubik";
						answerTxtBox.at_Txt.lineHeight = 22;
					}
					// הוספת תיבת הטקסט למסיח
					answer.addChild(answerTxtBox);
				}
				// העתקת סדר התשובות שנקבע באופן רנדומליות לתוך מערך חדש
				currentAnswersOrder.push([randomAnswers[rndAnswer][1], randomAnswers[rndAnswer][2]]);
				// הורדת התשובה שנוצרה מתוך מערך התשובות הרנדומלי כך שלא תווצר פעם נוספת
				randomAnswers.splice(rndAnswer, 1);
		
				// הגדרות עבור המסיח
				answer.y = 720;
				answer.name = "answer" + i;
		
				// הגדרת מיקומי מסיחים לפי כמות המסיחים בשאלה ובהתאם למיקומים המצויים במערך המסיחים
				if (answersNum == 2) {
					answer.x = answerPosition[0][i - 1];
				} else if (answersNum == 3) {
					answer.x = answerPosition[1][i - 1];
				} else if (answersNum == 4) {
					answer.x = answerPosition[2][i - 1];
				} else if (answersNum == 5) {
					answer.x = answerPosition[3][i - 1];
				}
				// הוספת המסיח לתבנית הגרפיקה
				gameGraphic.addChild(answer);
			}
			// מאזין ללחיצת מקשים
			window.addEventListener("keydown", handlekeypress);
		}
		
		// טיימר לשאלה
		function timerFunc() {
			// הורדת המשתנה באחד בכל שנייה
			timerSecs--;
			// אם השניות קטנות מ10, הדפסת 0 נוסף
			if (timerSecs < 10) {
				gameGraphic.getChildByName("timerTxt").text = "00:0" + timerSecs;
			} else {
				gameGraphic.getChildByName("timerTxt").text = "00:" + timerSecs;
			}
			// כשהטיימר מגיע ל0, איפוס האינטרוול
			if (timerSecs == 0) {
				
				//עצירת הטיימר
				clearInterval(timer);
				
				// הפעלת צליל של תשובה לא נכונה
				failSound = createjs.Sound.play("fail");
		
				// ביטול האפשרות ללחוץ על כפתור השהייה
				if (currentPlayer == 0) {
					gameGraphic.getChildByName("pauseBtn_right").removeEventListener("click", pauseGame);
					gameGraphic.getChildByName("pauseBtn_right").cursor = "default";
				} else {
					gameGraphic.getChildByName("pauseBtn_left").removeEventListener("click", pauseGame);
					gameGraphic.getChildByName("pauseBtn_left").cursor = "pointer";
				}
		
				//יצירת סימבול של נגמר הזמן
				var timeOver = new lib.timeOver_screen();
				timeOver.name = "timeOver_screen";
				timeOver.moveToNextTurn_btn.cursor = "pointer";
				gameGraphic.addChild(timeOver);
				timeOver.moveToNextTurn_btn.addEventListener("click", endOfTime);
		
				// חסימת האפשרות ללחוץ על המקשים
				window.removeEventListener("keydown", handlekeypress);
			}
		}
		
		function pauseGame(event) {
			// עצירת הטיימר
			clearInterval(timer);
			// הסרת האפשרות ללחוץ שוב על כפתור השהייה
			event.currentTarget.removeEventListener("click", pauseGame);
			event.currentTarget.cursor = "default";
		
			// יצירת מסך ההשהייה
			var pauseScreen = new lib.pauseGame_screen();
			pauseScreen.name = "pause_screen"
			gameGraphic.addChild(pauseScreen);
			pauseScreen.continueGame_btn.cursor = "pointer";
			pauseScreen.continueGame_btn.addEventListener("click", endPause);
		
			// חסימת האפשרות ללחוץ על המקשים
			window.removeEventListener("keydown", handlekeypress);
		}
		
		
		function endPause() {
			//קריאה לאינטרוול
			timer = setInterval(timerFunc, 1000);
			gameGraphic.removeChild(gameGraphic.getChildByName("pause_screen"));
		
			// מאזין ללחיצת מקשים
			window.addEventListener("keydown", handlekeypress);
		
			// החזרת האפשרות ללחוץ על כפתור העצירה
			if (currentPlayer == 0) {
				gameGraphic.getChildByName("pauseBtn_right").addEventListener("click", pauseGame);
				gameGraphic.getChildByName("pauseBtn_right").cursor = "pointer";
			} else {
				gameGraphic.getChildByName("pauseBtn_left").addEventListener("click", pauseGame);
				gameGraphic.getChildByName("pauseBtn_left").cursor = "pointer";
			}
		}
		
		function endOfTime() {
		
			firstTurn = false;
			lastQuestion = randomQues;
		
			if (currentPlayer == 0) {
				errorNumP1++;
				totalQuestionsP1++;
				gameGraphic.getChildByName("pauseBtn_right").addEventListener("click", pauseGame);
				gameGraphic.getChildByName("pauseBtn_right").cursor = "pointer";
		
			} else {
				errorNumP2++;
				totalQuestionsP2++;
				gameGraphic.getChildByName("pauseBtn_left").addEventListener("click", pauseGame);
				gameGraphic.getChildByName("pauseBtn_left").cursor = "pointer";
			}
		
			createTurn();
		}
		
		// ----------------------------------------------------------------------------
		//                          הגדלת תמונות במעבר עכבר
		// ----------------------------------------------------------------------------
		
		// מעבר עכבר על תמונה בשאלה
		function biggerImgQues(event) {
			// שמירת התמונה שעליה עבר העכבר במשתנה
			var img = event.currentTarget;
		
			// הסתרת האייקון של הפלוס במעבר עכבר
			img.getChildByName("plusQues").visible = false;
		
			// שינוי מיקום התמונה במעבר עכבר
			img.y = 225;
			img.x = -185;
		
			// הגדרת הרוחב והגובה של התמונה המוגדלת לפי היחס בין הרוחב לגובה והערכים המקסימליים
			if (img.getBounds().width > img.getBounds().height && img.getBounds().width / img.getBounds().height > 1.3) {
				console.log(img.getBounds().width / img.getBounds().height);
				img.scaleX = 320 / img.getBounds().width;
				img.scaleY = 320 / img.getBounds().width;
			} else {
				img.scaleX = 200 / img.getBounds().height;
				img.scaleY = 200 / img.getBounds().height;
		
			}
		}
		
