			img.getChildByName("plusQues").visible = true;
		
			// החזרת התמונה למיקום המקורי
			img.y = 200;
			img.x = -160;
		
			// החזרת התמונה לגודל המקורי
			img.scaleX = 1;
			img.scaleY = 1;
