		// בדיקת תשובה
		function checkQuestion() {
			// שינוי - התור הוא לא התור הראשון
			firstTurn = false;
			// שמירת הדמות הנוכחית 
			var current = gameGraphic.getChildByName("currentChar");
			// שמירת מספר המסיחים בשאלה
			var numOfAnswers = gameQues[randomQues].length - 1;
			// שמירת מספר האינדקס של התשובה שנבחרה
			var currentAnswerIndex = currentAnswer.name.charAt(6);
			//console.log(currentAnswerIndex);
		
			// עצירת הטיימר
			clearInterval(timer);
		
			// אם התשובה נכונה
			if (currentAnswersOrder[currentAnswerIndex - 1][1] == true) {
				// הורדת הטיקר מהשהיה
				createjs.Ticker.paused = false;
				// המסיח עובר לפריים המתאים
				currentAnswer.gotoAndStop(3);
				// הדמות עוברת לפריים המתאים
				current.gotoAndStop(14);
				// ניגון הסאונג של המד
				scoreSound = createjs.Sound.play("score");
		
		
				// אם השחקן הנוכחי אם השחקן הראשון
				if (currentPlayer == 0) {
					// ניגון אנימציית המד עד לפריים שמייצג את ההתקדמות של השחקן הראשון
					gameGraphic.getChildByName("activeScale").gotoAndPlay(frameAfterJumpP1);
					if (totalFrames / 2 - frameJump > frameAfterJumpP1) {
						// הוספת פריימים לפריים ממנו מתנגנת האנימציה 
						frameAfterJumpP1 += frameJump;
						// עדכון הפריים אליו תגיע האנימציה
						frameToJumpP1 = totalFrames - frameAfterJumpP1;
					} else {
						frameToJumpP1 = totalFrames / 2;
						frameAfterJumpP1 = totalFrames / 2;
					}
		
					//העלאת מספר התשובות הנכונות
					correctAnsP1++;
		
		
				} else { // אם השחקן הנוכחי הוא השחקן השני
					// ניגון אנימציית המד עד לפריים שמייצג את ההתקדמות של השחקן השני
					gameGraphic.getChildByName("activeScale").gotoAndPlay(frameAfterJumpP2);
		
					if (totalFrames / 2 - frameJump > frameAfterJumpP2) {
						// הוספת פריימים לפריים ממנו מתנגנת האנימציה 
						frameAfterJumpP2 += frameJump;
						// עדכון הפריים אליו תגיע האנימציה
						frameToJumpP2 = totalFrames - frameAfterJumpP2;
					} else {
						frameToJumpP2 = totalFrames / 2;
						frameAfterJumpP2 = totalFrames / 2;
					}
		
					//העלאת מספר התשובות הנכונות
					correctAnsP2++;
				}
		
				// הורדת השאלה ממאגר השאלה
				gameQues.splice(randomQues, 1);
		
		
			} else { // אם התשובה לא נכונה
				// הפעלת צליל של תשובה לא נכונה
				failSound = createjs.Sound.play("fail");
				
				// שינוי הפריים של התשובה והדמות לפריים המתאים
				currentAnswer.gotoAndStop(4);
				current.gotoAndPlay(4);
		
				if (currentPlayer == 0) {
					errorNumP1++;
				} else {
					errorNumP2++;
				}
		
				lastQuestion = randomQues;
			}
		
			// בדיקה איזה מהשחקנים הוא הנוכחי והעלאה של מספר השאלות הכולל באחד
			if (currentPlayer == 0) {
				totalQuestionsP1++;
			} else {
				totalQuestionsP2++;
			}
		
			//קריאה לפונקציה שתאפשר לחיצה על רווח בכדי לעבור לתור הבא
			setTimeout(moveToNextTurn, 600);
		}
		
