		// ----------------------------------------------------------------------------
		//                                 חישוב ציון
		// ----------------------------------------------------------------------------
		
		// פונקציה שמקבלת כפרמטרים את מספר הטעויות הכולל ומספר השאלות הכולל שקיבל השחקן ומחזירה ציון
		function calcGrade(totalErrors, totalQuestions) {
			var grade = Math.floor(((totalQuestions - totalErrors) / totalQuestions) * 100);
			return grade;
		}
		
