		// טיקר עבור אנימציית המד
		function scaleTick() {
			// אם הטיקר יצא מהשהיה
			if (createjs.Ticker.paused == false) {
				if (gameGraphic.getChildByName("activeScale").currentFrame == 20) {
					scoreSound = createjs.Sound.stop();
		
					//הפעלת צליל הגונג
					var gongSound = createjs.Sound.play("gong");
		
				}
		
				// אם השחקן הנוכחי הוא השחקן השני (עדכון השחקן הנוכחי מתבצע לפני הטיקר)
				if (currentPlayer == 0) {
					// בדיקה אם האנימציה הגיעה לפריים המתאים
					if (gameGraphic.getChildByName("activeScale").currentFrame == frameToJumpP1) {
						// עצירת האנימציה ומעבר לפריים התחלתי המייצג את ההתקדמות של השחקן הראשון
						gameGraphic.getChildByName("activeScale").gotoAndStop(frameAfterJumpP1);
						// השהית הטיקר
						createjs.Ticker.paused = true;
		
					}
					// אם השחקן הנוכחי הוא השחקן הראשון
				} else {
					// בדיקה אם האנימציה הגיעה לפריים המתאים
					if (gameGraphic.getChildByName("activeScale").currentFrame == frameToJumpP2) {
						// עצירת האנימציה ומעבר לפריים התחלתי המייצג את ההתקדמות של השחקן השני
						gameGraphic.getChildByName("activeScale").gotoAndStop(frameAfterJumpP2);
						// השהית הטיקר
						createjs.Ticker.paused = true;
					}
				}
			}
		}
		
		// ----------------------------------------------------------------------------
		//                             חישוב זמן כולל
		// ----------------------------------------------------------------------------
		
		function getTotalTime(timeInSecs) {
			var min = Math.floor(timeInSecs / 60);
			var sec = timeInSecs - 60 * min;
		
			var minAfterCheck;
			var secAfterCheck;
		
			if (min < 10) {
				minAfterCheck = "0" + min + ":";
				if (min == 0) {
					minAfterCheck = "00:";
				}
			} else {
				minAfterCheck = min + ":";
			}
		
			if (sec < 10) {
				secAfterCheck = "0" + sec;
				if (sec == 0) {
					secAfterCheck = "00";
				}
			} else {
				secAfterCheck = sec;
			}
		
			return minAfterCheck + secAfterCheck;
		}
		
